const User = () => {
    const user = [
        { name: 'mohan', age: 20 },
        { name: 'sohan', age: 21 },
        { name: 'rohan', age: 56 }
    ]
    return <>
        <h1 className="text-center">this is listing page</h1>
        <div className="text-center">
        {user.map((item) =>
            <div>
                {item.name}
            </div>
)}
</div>
    </>
}
export default User;
